import React from 'react';
import { motion } from 'framer-motion';
import { useInView } from 'react-intersection-observer';
import { FaPhone, FaWeixin, FaTruck, FaGift } from 'react-icons/fa';

const Pricing: React.FC = () => {
  const { ref, inView } = useInView({
    triggerOnce: true,
    threshold: 0.2
  });

  const packages = [
    {
      name: '尝鲜装',
      weight: '2斤',
      price: '39',
      features: ['精选大果', '顺丰包邮', '破损包赔'],
      popular: false
    },
    {
      name: '家庭装',
      weight: '5斤',
      price: '89',
      originalPrice: '99',
      features: ['精选大果', '顺丰包邮', '破损包赔', '送保鲜袋'],
      popular: true
    },
    {
      name: '礼盒装',
      weight: '8斤',
      price: '138',
      features: ['特级大果', '精美礼盒', '顺丰包邮', '破损包赔'],
      popular: false
    }
  ];

  return (
    <section className="pricing-section" ref={ref}>
      <motion.div 
        className="container"
        initial={{ opacity: 0 }}
        animate={inView ? { opacity: 1 } : {}}
        transition={{ duration: 0.8 }}
      >
        <motion.h2 
          className="section-title"
          initial={{ y: 30, opacity: 0 }}
          animate={inView ? { y: 0, opacity: 1 } : {}}
          transition={{ delay: 0.2, duration: 0.8 }}
        >
          新鲜直达
        </motion.h2>
        
        <div className="pricing-cards">
          {packages.map((pkg, index) => (
            <motion.div 
              key={index}
              className={`price-card ${pkg.popular ? 'popular' : ''}`}
              initial={{ y: 50, opacity: 0 }}
              animate={inView ? { y: 0, opacity: 1 } : {}}
              transition={{ delay: 0.3 + index * 0.1, duration: 0.8 }}
              whileHover={{ y: -10 }}
            >
              {pkg.popular && <div className="popular-badge">热销</div>}
              <h3>{pkg.name}</h3>
              <div className="weight">{pkg.weight}</div>
              <div className="price-info">
                <span className="currency">¥</span>
                <span className="price">{pkg.price}</span>
                {pkg.originalPrice && (
                  <span className="original-price">¥{pkg.originalPrice}</span>
                )}
              </div>
              <ul className="features">
                {pkg.features.map((feature, idx) => (
                  <li key={idx}>
                    <span className="check">✓</span>
                    {feature}
                  </li>
                ))}
              </ul>
              <motion.button 
                className="order-btn"
                whileHover={{ scale: 1.05 }}
                whileTap={{ scale: 0.95 }}
              >
                立即订购
              </motion.button>
            </motion.div>
          ))}
        </div>
        
        <motion.div 
          className="contact-section"
          initial={{ y: 30, opacity: 0 }}
          animate={inView ? { y: 0, opacity: 1 } : {}}
          transition={{ delay: 0.8, duration: 0.8 }}
        >
          <h3>订购方式</h3>
          <div className="contact-methods">
            <motion.div 
              className="contact-item"
              whileHover={{ scale: 1.05 }}
            >
              <FaPhone className="contact-icon" />
              <div className="contact-info">
                <p>电话订购</p>
                <p className="contact-detail">138-8888-8888</p>
              </div>
            </motion.div>
            <motion.div 
              className="contact-item"
              whileHover={{ scale: 1.05 }}
            >
              <FaWeixin className="contact-icon" />
              <div className="contact-info">
                <p>微信订购</p>
                <p className="contact-detail">扫码添加</p>
              </div>
            </motion.div>
          </div>
        </motion.div>
        
        <motion.div 
          className="guarantee"
          initial={{ opacity: 0 }}
          animate={inView ? { opacity: 1 } : {}}
          transition={{ delay: 1, duration: 0.8 }}
        >
          <div className="guarantee-item">
            <FaTruck />
            <span>现摘现发</span>
          </div>
          <div className="guarantee-item">
            <FaGift />
            <span>精美包装</span>
          </div>
        </motion.div>
        
        <motion.div 
          className="footer-message"
          initial={{ opacity: 0 }}
          animate={inView ? { opacity: 1 } : {}}
          transition={{ delay: 1.2, duration: 0.8 }}
        >
          <p>感谢您选择奶奶的猕猴桃</p>
          <p>每一颗都是用心的味道 💚</p>
        </motion.div>
      </motion.div>
    </section>
  );
};

export default Pricing;
